var AboutUtils={retranslate:function(){$("[data-tr]").each(function(){AboutUtils.TR($(this).attr("data-tr"))})},tr:function(a){return SimpleChat.translate(a)},TR:function(a){$("[data-tr='"+a+"']").html(AboutUtils.tr(a))},toggle:function(){var a=$("#"+$(this).attr("id")+"-body");if(a.is(":hidden")){a.show();$(this).removeClass("toggle-expand");$(this).addClass("toggle")}else{a.hide();$(this).removeClass("toggle");$(this).addClass("toggle-expand")}}};$(document).ready(function(){$(".header").click(AboutUtils.toggle);AboutUtils.retranslate();$("#version").html('<a href="http://wiki.schat.me/Simple_Chat_'+About.version("app")+'">'+About.version("app")+"</a>");$("#qt-version").text(About.version("qt"));$("#webkit-version").text(About.version("webkit"));$("#preferences").html(About.path("preferences"))});if(typeof About==="undefined"){About={path:function(a){return a},version:function(a){return a}}}if(typeof SimpleChat==="undefined"){SimpleChat={translate:function(a){return a}}}else{SimpleChat.retranslated.connect(AboutUtils.retranslate)};